  return (
    <Select
      view={view}
      color={color}
      items={TOP_100_FILMS}
      itemPredicate={Films.itemPredicate}
      itemRenderer={Films.itemRenderer}
      noResults={<MenuItem disabled={true} text="No results." />}
    />
  );
};
